import React, { useEffect, useState } from "react";
import homeApi from "../../../redux/api/home-api"; // Import the API file that contains the listAll function

const HomeSelect = () => {
  const [homes, setHomes] = useState([]);

  useEffect(() => {
    const fetchHomes = async () => {
      try {
        const city = "New York"; // Set the desired city value
        const homesData = await homeApi.listAlll(city);
        setHomes(homesData);
      } catch (error) {
        console.error(error);
      }
    };

    fetchHomes();
  }, []);

  return (
    <div>
      <select>
        {homes.map((home) => (
          <option key={home.id} value={home.id}>
            {home.name}
          </option>
        ))}
      </select>
    </div>
  );
};

export default HomeSelect;
